  const [cookies, setCookie, removeCookie] = useCookies(["user"]);

  function handleSetCookie() {
    setCookie("user", "monika", { path: '/' });
  }

  return (
      <button onClick={handleSetCookie}>Set Cookie</button>
  );
}
